import React from "react";
import styled from "styled-components";

const LoginUserInfo = () => {
    return (
        <Wrapper>
          <p className="title">로그인</p>
          <hr className="hr"/>
          <div className="login-components">
            <p className="login-intro">사용하실 닉네임을 입력해주세요</p>
            <p>닉네임</p>
            <input type="text"></input>
            <button>다음</button>
          </div>
        </Wrapper>
    );
};

export default LoginUserInfo;

const Wrapper = styled.div`
.login-components{
  max-width: 375px;
  margin: 0 auto; 
  display: flex;
  flex-direction: column; 
  justify-content: center; 
  align-items: center; 
}
.login-intro{
  color: #212529;
  font-size: 29px;
  font-family: Pretendard Variable;
  font-weight: 700;
  line-height: 32px;
  word-wrap: break-word;
}
  .title {
    color: #212529;
    font-size: 32px;
    font-family: Pretendard Variable;
    font-weight: 700;
    line-height: 40px;
    word-wrap: break-word;
    padding-left: 170px;
    padding-right: 170px; 
  }
  .hr{
    border-top: dashed 1px #dddddd;
  }
`
